using System;
using System.IO;
using CommandRouting.Handlers;
using Sample.CommandSets.Account;

namespace Sample.Commands.Logo
{
    public class DownloadLogo : CommandHandler<EmptyRequest, Stream>
    {
        private string logoImage =
            "";

        public override HandlerResult Dispatch(EmptyRequest request)
        {
            Byte[] buffer = Convert.FromBase64String(logoImage);
            MemoryStream stream = new MemoryStream(buffer);
            return File(stream, "image/png", "command-routing.png");
        }
    }
}